import React from 'react';
import './App.css';
import useSticky from "./useSticky.js";
import {Nav, Intro} from './Home.js';

function App() {
  const {isSticky} = useSticky()
  return (
    <div>
      <Nav sticky = {isSticky}/>
      <Intro/>
      <Intro/>
    </div>
  );
}

export default App;
